import { Container } from 'react-bootstrap';
import NavbarC from './component/NavbarC';
import Hider from './component/Hider'
import Category from './component/Category'
import Cardse from './component/Cardse'
import './App.css';
import img1 from '../.'
import img2 from '../imag/img2.jpg'
import img3 from '../imag/img3.jpg'
import img4 from '../imag/img4.jpg'
import img5 from '../imag/img5.jpg'

function App() {
  return (
    <div className="font color-body">
      <NavbarC/>
      <Container>
        <Hider/>
        <Category/>
        <Cardse Imag={img1}/>
        <Cardse Imag={img2}/>
        <Cardse Imag={img3}/>
        <Cardse Imag={img4}/>
        <Cardse Imag={img5}/>
      </Container>
    </div>
  );
}

export default App;
